import { Button, ButtonIcon, ButtonText, View } from "@gluestack-ui/themed";
import React from "react";
import { StyleSheet } from "react-native";

interface Props {
    label: string;
    bgColor: string;
    onPress: () => {};
}

export const ButtonMd = ({ label, bgColor, onPress }: Props) => {
    return (
        <View>
            <Button
                size="md"
                variant="solid"
                isDisabled={false}
                isFocusVisible={false}
                style={styles.button}
                onPress={() => console.log("pressed")}
            >
                <ButtonText>Add </ButtonText>
            </Button>
        </View>
    );
};

const styles = StyleSheet.create({
    button: {
        backgroundColor: "#007bff", // Rosa
        padding: 15,
        borderRadius: 5,
    },
    buttonText: {
        color: "#fff",
        fontSize: 18,
    },
});
